olean = false;        // to check if user is logged in\n  selectedOrganization: boolean = false;\n  organizations: Object;            //array for Organization dropdown\n  userTypes: Object;                //array for User Type dropdown\n  loading: boolean = false;\n  selectedOrg: string;\n\n  /*\n     CONSTRUCTOR\n   */\n  constructor(private service: AdminAPIService, private formBuilder: FormBuilder, private snackBar: MatSnackBar, private dialog: MatDialog, private router: Router) {\n    this.loginForm = this.formBuilder.group({\n      organization: ['', Validators.required],\n      userType: ['', Validators.required],\n      login_email: ['', Validators.required],\n      login_password: ['', Validators.required]\n    })\n  }\n\n  login() {\n\n    this.submitted = true;\n\n    if (this.loginForm.invalid) {\n      return;\n    }\n\n    this.success = true;\n    this.loading = true;\n\n    const Lemail = this.loginForm.controls.login_email.value;\n    const Lpassw = this.loginForm.controls.login_password.value;\n    const Lorg = this.loginForm.controls.organization.value;\n    const LuserType = this.loginForm.controls.userType.value;\n\n    const details: LoginInfo = { email: Lemail, password: Lpassw, organization: Lorg, userType: LuserType };\n\n    this.service.login(details).subscribe((response: any) => {\n\n      this.loading = false;\n      \n      if (response.success == true) {\n        //POPUP MESSAGE\n        let snackBarRef = this.snackBar.open(\"Successfully Logged In\", \"Dismiss\", {\n          duration: 3000\n        });\n\n        this.service.setToken(response.data.token);\n        this.service.setLoggedin();\n\n        if(details.organization == \"FABI\")\n        {\n          if(details.userType == \"Admin\" || details.userType == \"Database Admin\")\n          {\n            try {\n              this.router.navigate(['fabi-admin-dashboard']);\n            } catch(err) {\n              console.log(\"Could not redirect to dashboard: \" + err.message);\n            }\n            \n          }\n          else {\n            try {\n              this.router.navigate(['fabi-staff-dashboard']);\n            } catch(err) {\n              console.log(\"Could not redirect to dashboard: \" + err.message);\n            }\n          }\n        }\n        else\n        {\n          if(details.userType == \"Admin\")\n          { \n            try {\n              this.router.navigate(['org-admin-dashboard']);\n            } catch(err) {\n              console.log(\"Could not redirect to dashboard: \" + err.message);\n            }\n          } else\n          {\n            try {\n              this.router.navigate(['org-member-dashboard']);\n            } catch(err) {\n              console.log(\"Could not redirect to dashboard: \" + err.message);\n            }\n          }\n        }\n\n      } else if (response.success == false) {\n        //POPUP MESSAGE\n        let dialogRef = this.dialog.open(ErrorComponent, { data: { error: \"Could Not Log In\", message: response.message } });\n        dialogRef.afterClosed().subscribe((result) => {\n          if (result == \"Retry\") {\n            this.login();\n          }\n          //Take out when authenication is working - Just for test/demp purposes\n          this.router.navigate(['sample-form']);\n          //\n        })\n      }\n\n      this.loading = false;\n\n    }, (err: HttpErrorResponse) => {\n      //POPUP MESSAGE\n      let dialogRef = this.dialog.open(ErrorComponent, { data: { error: \"Could Not Log In\", message: err.message } });\n      dialogRef.afterClosed().subscribe((result) => {\n        if (result == \"Retry\") {\n          this.login();\n        }\n      })\n      console.log(\"ERROR:\" + err.message);\n      this.loading = false;\n    })\n  }\n\n  ngOnInit() {\n    this.loggedIn = this.service.isLoggedIn();\n    if (this.loggedIn == true) {\n      this.router.navigate(['sample-form']);\n    }\n\n    this.service.getAllOrganizations().subscribe((response:any) => {\n      if(response.success == true) {\n        // var orgs = response.data.content.qs.Organizations;\n        // forEach(var i in orgs)\n        // {\n        //   this.organizations.push(i);\n        // }\n        this.organizations = response.data.content.qs.Organizations;\n        \n      } else if (response.success == false) {\n        //POPUP MESSAGE\n        let dialogRef = this.dialog.open(ErrorComponent, {data: {error: \"Could Not Load Organizations\", message: response.error.message}});\n        dialogRef.afterClosed().subscribe((result) => {\n          if(result == \"Retry\") {\n            this.ngOnInit();\n          }\n        })\n      }    \n    }, (err: HttpErrorResponse) => {\n      //POPUP MESSAGE\n      let dialogRef = this.dialog.open(ErrorComponent, {data: {error: \"Could Not Load Organizations\", message: err.message}});\n      dialogRef.afterClosed().subscribe((result) => {\n        if(result == \"Retry\") {\n          this.ngOnInit();\n        }\n      })\n      console.log(\"ERROR:\" + err.message);\n    })\n\n  }\n\n  displayUserTypes() \n  {\n    if(this.selectedOrg == \"FABI\")\n    {\n      this.userTypes = [\n        {\n          \"ID\":1,\n          \"Name\":\"Admin\"\n        },\n        {\n          \"ID\":2,\n          \"Name\":\"Staff\"\n        },\n        {\n          \"ID\":3,\n          \"Name\":\"Database Admin\"\n        }\n      ]\n\n    }\n    else {\n      this.userTypes = [\n        {\n          \"ID\":1,\n          \"Name\":\"Admin\"\n        },\n        {\n          \"ID\":2,\n          \"Name\":\"Member\"\n        }\n      ]\n    }\n  }\n\n}\n\n    \n\n\n\n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"interfaces/OrganizationAdmin.html":{"url":"interfaces/OrganizationAdmin.html","title":"interface - OrganizationAdmin","body":"\n                   \n\n\n\n\n\n\n\n\n\n\n\n\n\n  Interfaces\n  OrganizationAdmin\n\n\n\n        \n            Info\n        \n        \n            Source\n        \n\n\n\n    \n        \n            File\n        \n        \n            src/app/admin-api.service.ts\n        \n\n\n\n        \n            Index\n            \n                \n                    \n                        \n                            Properties\n                        \n                    \n                    \n                        \n                            \n                                \n                                        email\n                                \n                                \n                                        name\n                                \n                                \n                                        phone\n                                \n                                \n                                        surname\n                                \n                            \n                        \n                    \n                \n            \n        \n\n\n\n            \n                Properties\n                    \n                        \n                                \n                                    \n                                        \n                                        email\n                                    \n                                \n                                \n                                    \n                                        email:         string\n\n                                    \n                                \n\n\n                                    \n                                        \n                                            Type :         string\n\n                                        \n                                    \n\n\n\n\n\n                        \n                    \n                    \n                        \n                                \n                                    \n                                        \n                                        name\n                                    \n                                \n                                \n                                    \n                                        name:         string\n\n                                    \n                                \n\n\n                                    \n                                        \n                                            Type :         string\n\n                                        \n                                    \n\n\n\n\n\n                        \n                    \n                    \n                        \n                                \n                                    \n                                        \n                                        phone\n                                    \n                                \n                                \n                                    \n                                        phone:         number\n\n                                    \n                                \n\n\n                                    \n                                        \n                                            Type :         number\n\n                                        \n                                    \n\n\n\n\n\n                        \n                    \n                    \n                        \n                                \n                                    \n                                        \n                                        surname\n                                    \n                                \n                                \n                                    \n                                        surname:         string\n\n                                    \n                                \n\n\n                                    \n                                        \n                                            Type :         string\n\n                                        \n                                    \n\n\n\n\n\n                        \n                    \n            \n    \n\n\n    \n        import { Injectable } from '@angular/core';\nimport { HttpClient } from '@angular/common/http';\nimport { HttpHeaders } from '@angular/common/http';\nimport { registerContentQuery } from '@angular/core/src/render3';\nimport { StaticInjector } from '@angular/core/src/di/injector';\nimport { BehaviorSubject } from 'rxjs';\n\n\nconst getAllOrganizationsURL: string = 'https://user-management-dot-api-fabi.appspot.com/getAllOrganizations';\nconst createOrganizationURL: string = 'https://user-management-dot-api-fabi.appspot.com/createOrganization';\nconst getOrgDetailsURL: string = '';\n\nconst authenticateFABIAdminURL: string = 'https://authentication-dot-api-fabi.appspot.com/loginAdmin';\nconst authenticateStaffURL: string = 'https://authentication-dot-api-fabi.appspot.com/loginFabiStaff';\nconst authenticateDataAdminURL: string = 'https://authentication-dot-api-fabi.appspot.com/loginDatabaseAdmin';\nconst authenticateOrgURL: string = 'https://authentication-dot-api-fabi.appspot.com/loginOrgAdmin';\nconst authenticateOrgMemberURL: string = 'https://authentication-dot-api-fabi.appspot.com/loginOrgMember';\n\nconst addStaffMemberURL: string = 'https://user-management-dot-api-fabi.appspot.com/addStaff';\n\nconst addFABIAdminURL: string = 'https://user-management-dot-api-fabi.appspot.com/addFabiAdmin';\n\n\nconst portingURL: string = 'https://database-management-dot-api-fabi.appspot.com/porting';\n\n\n\nexport interface LoginInfo {\n  email: string;\n  userType: string,\n  organization: string,\n  password: string;\n}\n\nexport interface OrganizationInfo {\n  orgName: string,\n  location: string\n}\n\nexport interface OrganizationAdmin {\n  name: string,\n  surname: string,\n  email: string,\n  phone: number\n}\n\nexport interface StaffInfo {\n  name: string;\n  surname: string,\n  email: string,\n  phone: number,\n  position: string\n}\n\n\n@Injectable({\n  providedIn: 'root'\n})\nexport class AdminAPIService {\n\n  private APItoken : string;\n  loggedIn: boolean = false; \n\n  constructor(private http: HttpClient) { }\n\n  setToken(token: string)\n  {\n    this.APItoken = token;\n  }\n\n  setLoggedin()\n  {\n    this.loggedIn = true;\n  }\n\n  isLoggedIn()\n  {\n    return this.loggedIn;\n  }\n\n\n  getAllOrganizations() {\n\n    const options = {\n      method: 'POST',\n      url: getAllOrganizationsURL,\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        'Accept': 'application/json'\n      },\n      json: true\n    };\n\n    return this.http.request('POST', getAllOrganizationsURL, options);\n    \n  }\n\n\n  getAllUserTypes() {\n\n    // const options = {\n    //   method: 'POST',\n    //   url: getAllOrganizationsURL,\n    //   headers: {\n    //     'cache-control': 'no-cache',\n    //     'Content-Type': 'application/json',\n    //     'Accept': 'application/json'\n    //   },\n    //   json: true\n    // };\n\n    // return this.http.request('POST', getAllOrganizationsURL, options);\n    \n  }\n\n\n  login(details: LoginInfo) {\n  \n    if(details.organization == \"FABI\")\n    {\n      if(details.userType == \"Admin\")\n      {\n        return this.authenticateFABIAdmin(details);\n      }\n      else if(details.userType == \"Database Admin\")\n      {\n        return this.authenticateDataAdmin(details);\n      }\n      else{\n        return this.authenticateFABIStaff(details);\n      }\n    }\n\n    if(details.organization != \"FABI\")\n    {\n      if(details.userType == \"Admin\")\n      {\n        return this.authenticateOrgAdmin(details);\n      }\n      else if(details.userType == \"Member\")\n      {\n        return this.authenticateOrgMember(details);\n      }\n    }\n\n  }\n\n  authenticateFABIAdmin(details: LoginInfo) \n  {\n    const postData = details;\n\n    const options = {\n      method: 'POST',\n      url: authenticateFABIAdminURL,\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        \"Access-Control-Allow-Origin\":\"*\",\n        'Accept': 'application/json'\n      },\n      body:postData,\n      json: true\n    };\n\n    return this.http.request('POST', authenticateFABIAdminURL, options);\n  }\n\n  authenticateFABIStaff(details: LoginInfo) \n  {\n    const postData = details;\n\n    const options = {\n      method: 'POST',\n      url: authenticateStaffURL,\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        \"Access-Control-Allow-Origin\":\"*\",\n        'Accept': 'application/json'\n      },\n      body:postData,\n      json: true\n    };\n\n    return this.http.request('POST', authenticateStaffURL, options);\n  }\n  \n\n  authenticateDataAdmin(details: LoginInfo) \n  {\n    const postData = details;\n\n    const options = {\n      method: 'POST',\n      url: authenticateDataAdminURL,\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        \"Access-Control-Allow-Origin\":\"*\",\n        'Accept': 'application/json'\n      },\n      body:postData,\n      json: true\n    };\n\n    return this.http.request('POST', authenticateDataAdminURL, options);\n  }\n\n  authenticateOrgAdmin(details: LoginInfo) \n  {\n    const postData = {\n      \"email\": details.email,\n      \"password\": details.password,\n      \"orgName\":details.organization\n    }\n\n    const options = {\n      method: 'POST',\n      url: authenticateOrgURL,\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        \"Access-Control-Allow-Origin\":\"*\",\n        'Accept': 'application/json'\n      },\n      body:postData,\n      json: true\n    };\n\n    return this.http.request('POST', authenticateOrgURL, options);\n  }\n\n  authenticateOrgMember(details: LoginInfo) \n  {\n    const postData = {\n      \"email\": details.email,\n      \"password\": details.password,\n      \"orgName\":details.organization\n    }\n\n    const options = {\n      method: 'POST',\n      url: authenticateOrgMemberURL,\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        \"Access-Control-Allow-Origin\":\"*\",\n        'Accept': 'application/json'\n      },\n      body:postData,\n      json: true\n    };\n\n    return this.http.request('POST', authenticateOrgMemberURL, options);\n  }\n\n  porting(jsonObject: Object)\n  {\n    const postData = {\n      \"databaseName\": \"Testing_Third_Api_Call\",\n      \"data\":jsonObject\n    };\n\n    const options = {\n      method: 'POST',\n      url: portingURL,\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        \"Access-Control-Allow-Origin\":\"*\",\n        'Accept': 'application/json'\n      },\n      body:postData,\n      json: true\n    };\n\n    return this.http.request('POST', portingURL, options);\n  }\n\n  createOrganization(orgInfo: OrganizationInfo, adminInfo: OrganizationAdmin)\n  {\n    const postData = {\n      \"orgName\": orgInfo.orgName,\n      \"admin\": adminInfo\n    }\n\n    const options = {\n      method: 'POST',\n      url: createOrganizationURL,\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        \"Access-Control-Allow-Origin\":\"*\",\n        'Accept': 'application/json'\n      },\n      body:postData,\n      json: true\n    };\n\n    return this.http.request('POST', createOrganizationURL, options);\n  }\n\n  addStaffMember(staffInfo: StaffInfo)\n  {\n    if(staffInfo.position == \"Admin\")\n    {\n      return this.addFABIAdmin(staffInfo);\n\n    } else {\n      const postData = {\n        \"staff\": staffInfo\n      }\n  \n      const options = {\n        method: 'POST',\n        url: addStaffMemberURL,\n        headers: {\n          'cache-control': 'no-cache',\n          'Content-Type': 'application/json',\n          \"Access-Control-Allow-Origin\":\"*\",\n          'Accept': 'application/json'\n        },\n        body:postData,\n        json: true\n      };\n  \n      return this.http.request('POST', addStaffMemberURL, options);\n    }\n   \n  }\n\n  addFABIAdmin(staffInfo: StaffInfo)\n  {\n    const postData = {\n      \"admin\": staffInfo\n    }\n\n    const options = {\n      method: 'POST',\n      url: addFABIAdminURL,\n      headers: {\n        'cache-control': 'no-cache',\n        'Content-Type': 'application/json',\n        \"Access-Control-Allow-Origin\":\"*\",\n        'Accept': 'application/json'\n      },\n      body:postData,\n      json: true\n    };\n\n    return this.http.request('POST', addFABIAdminURL, options);\n  }\n\n\n\n\n\n\n\n\n}\n\n    \n\n\n\n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"injectables/OrganizationApiService.html":{"url":"injectables/OrganizationApiService.html","title":"injectable - OrganizationApiService","body":"\n                   \n\n\n\n\n\n\n\n\n  Injectables\n  OrganizationApiService\n\n\n\n        \n            Info\n        \n        \n            Source\n        \n\n\n\n    \n        \n            File\n        \n        \n            src/app/organization-api.service.ts\n        \n\n\n\n\n            \n    Index\n    \n        \n\n                \n                    \n                        Methods\n                    \n                \n                \n                    \n                        \n                            \n                                addOrgMember\n                            \n                            \n                                retrieveAllSamples\n                            \n                           